import React from "react";
import styled from "styled-components";
import { back_gif } from "../../assets/img/login_back.gif";
import { back_img } from "../../assets/img/login_back.jpg";
import ruff from "../../assets/img/login_back.jpg";

const LoginLeftContainer = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  width: calc(100% / 2);
  height: 100%;
  /* background-image: url(${back_img}); */
  background-position: center;
  background-repeat: no-repeat;
  background-size: cover;
`;
const BackgroundImage = styled.div`
  background-image: url(${ruff});
`;

export const LoginLeft = () => {
  return (
    <LoginLeftContainer>
      <BackgroundImage></BackgroundImage>
    </LoginLeftContainer>
  );
};
